def isSubsequence(s: str, t: str) -> bool:
    if (s == ""):
        return True
    tempS = list(s);
    seq = ""
    for char in t:
        if char == tempS[0]:
            seq += (char+"")
            tempS.remove(char)
        if len(tempS) == 0:
            break
    if seq == s:
        return True
    return False

print(isSubsequence("leeeeetcode", ""))